INSERT INTO `sylius_product_translation` VALUES (181,181,'Coeur de vigneron','coeur-de-vigneron','Dgustons un verre de vin : le vigneron y a dpos une part de son me et une pince de son cur. Balade que vous propose cet ouvrage... Travail de la vigne et du vin, lgendes, dictons et proverbes... conts au fil des mois.',NULL,NULL,NULL,'fr_FR'),(182,182,'Le Petit Bacchus','le-petit-bacchus','Passionn de vin et de gastronomie, prsent toute lanne aux cts des vignerons, jai cr \"Le Petit Bacchus\" afin de vous faciliter laccs  la dgustation du vin. Ce carnet a t dvelopp de manire simple et ludique. Il vous permettra de placer trs rapidement des mots sur ce que vous voyez, sentez et gotez.\r\nIl vous donnera lopportunit de vous souvenir de vos coups de curs, de vos meilleurs rapports prix/plaisir, ainsi que de vos rencontres avec les vignerons.\r\nCet outil vous aidera galement  tre plus  laise dans votre relation avec le vin : repas de famille, repas professionnels, discussions entre amis... Synonyme dart et de culture, lnologie vous offre loccasion daborder de nombreux sujets tout aussi passionnants : gographie, histoire, littrature, photographie, voyages, arts plastiques, etc.\r\nLe vin, une question de bon(s) sens !',NULL,NULL,NULL,'fr_FR'),(183,183,'L\'le sacre','l-ile-sacree','Labb Henri Boudet est cur de Rennes-les-Bains, petite station thermale trs prise en cette fin de dix-neuvime sicle. Il publie en 1886 un livre singulier et obscur :  La Vraie Langue celtique et le Cromleck de Rennes-les-Bains  dans lequel il prtend restituer la langue originelle grce  langlais moderne, trs proche, selon lui, de la langue des Tectosages, tribu celte du sud-ouest de la Gaule.\r\nPour la premire fois, La Vraie Langue celtique de labb Boudet est entirement dcode. Aprs quatre ans de travail acharn et mthodique, lauteur de Lle Sacre met au jour un double secret  dtat et dglise  jusquici totalement oubli des historiens....\r\nLivre historique et passionnant  dcouvrir, cest un magnifique cadeau  offrir ou  soffrir pour Nol ou toutes autres circonstances. Rservez ds  prsent votre livre....\'',NULL,NULL,NULL,'fr_FR'),(184,184,'Dcouvertes Gourmandes','decouvertes-gourmandes','Rhne-Alpes Passions se met  table et prsente ses \"Dcouvertes gourmandes\" issues de la rgion Rhne-Alpes.\r\nPartez  la rencontre de 46 passionns issus des mtiers de bouche de la rgion Rhne-Alpes avec comme particularit et fil rouge le vcu dun parcours souvent riche en motions, rencontres et changes.\r\nDes hommes et des femmes, certes au service de notre quotidien, qui travaillent toujours dans lexcellence et la passion pour rvler le meilleur  nos papilles gustatives.\r\nDes motivations suprmes pour avancer dans ces professions, dont lunique objectif est de donner du plaisir gourmand au plus grand nombre dentre nous...\r\nUn grand Monsieur au service de la gastronomie de France...merci pour votre soutien mon cher Paul Bocuse  cet ouvrage.\r\nUne seule envie : dvorer ce livre !',NULL,NULL,NULL,'fr_FR'),(185,185,'L\'Afficheur tombe dans le panneau','l-afficheur-tombe-dans-le-panneau','Du monde qui nous entoure, de limmdiat et du quotidien au prsent, mme si par \r\n        prcaution laction se droule dans les annes 80. Mais il y a forcment un pass, le sien nest fait que de \r\n        fugaces rminiscences et cest un peu le moteur du prsent, et il a un avenir, sauf que le sien na pas de but \r\n        si ce nest daider ses amis, ses proches ses rencontres, et cest le carburant du prsent. Par son mtier il \r\n        est dehors, dans la rue o il voit la ville depuis le coin du trottoir jusqu toute lagglomration. Cest un \r\n        urbain qui vit aux pulsations de la cit selon lheure du jour et la saison. Cest un grand tmoin qui veut \r\n        rester en retrait, mais ne peut sempcher dintervenir pour aider, selon son instinct ou  la demande ses amis.\r\n         Il dguste aussi le parler lyonnais, qui enjolive ses changes. Son pass, avant Lyon, fut radicalement \r\n         diffrent de son prsent, il sen sert pour aider, jamais pour se valoriser. On ne sait pas vraiment do \r\n         il vient et il ne sait pas o il va, mais seulement o il est.\'',NULL,NULL,NULL,'fr_FR'),(186,186,'Les Pierres Dores, motions et images...','les-pierres-dorees-emotions-et-images','Sans doute avez-vous peru au fil du temps, ma tendresse, mon amour, \r\n        voire ma passion pour les petits  Villages du Beaujolais en Pierres Dores  que je dcouvre au gr de \r\n        mes pas : dcouvertes de scnes touchantes ou vocatrices dinstants de vie, lumires et couleurs, chaleur \r\n        des pierres, douceur vallonne des paysages de vignes... Ce plaisir des dcouvertes, ces lieux que \r\n        j\'affectionne, je souhaite les partager avec vous au travers dun ouvrage photographique dune \r\n        centaine de pages...tmoignages de ces jolis ptales dune vie simple que je me suis plu  \r\n        effeuiller au gr des annes et des saisons.... Au gr de mes pas...quelques jolies dcouvertes...\r\n        des scnes lumineuses au cur du Beaujolais des Pierres Dores...',NULL,NULL,NULL,'fr_FR'),(187,187,'Mousselines au fil du temps, une dition haute en couleurs','mousselines-au-fil-du-temps-une-edition-haute-en-couleurs','Louvrage retrace lhistoire de lorganisation des Mousselines 2015 de la 1re \r\n        runion (18 avril 2014)  la fin de lvnement (le grand dfil avec concert et feu dartifice du 28 \r\n        juin 2015) au travers dun livre de photographies lgendes. Au fil des pages et des photographies, \r\n        dcouvrez toute lorganisation, pendant plus d\'\'un an, au travers de la mobilisation humaine avec \r\n        de nombreux bnvoles ainsi que lensemble des habitants de Tarare pour aboutir  une vritable russite.',NULL,NULL,NULL,'fr_FR'),(188,188,'Voyages d\'un chien amoureux','voyages-d-un-chien-amoureux','Franois Mercier revendique lerrance entre le trait libre qui raconte et le \r\n        dessin qui construit. Il avoue la sduction que reprsente la peinture et le graphisme qui permet de \r\n        conduire rapidement  la matrialisation de l\'ide par rapport  l\'architecture qui ncessite la \r\n        mise en oeuvre de beaucoup de moyens avec des intermdiaires qui  parasitent  souvent le fonctionnement \r\n        cratif. Expositions  Paris, Clermont-Ferrand, Valence, Lyon, Stockholm, etc.... En Dcembre 2015, il \r\n        sest lanc dans lcriture dun roman dont le titre est : Voyages dun chien amoureux, Un homme  poil.',NULL,NULL,NULL,'fr_FR'),(189,189,'Un instant clair','un-instant-eclaire','Le Graphistographe est de ceux qui vous charment autant quils vous drangent. \r\n        Et en plus, il adore a. Derrire son appareil, il a cette capacit  creuser,  saisir des motions \r\n        dans leur intgrit et sans toujours les nommer puisque souvent ses photos parlent delles-mmes. Son \r\n        objectif est saisissant, son regard ressemble  celui du prdateur qui, loin dtre destructeur ou chasseur, \r\n        tente dabord de voir puis de montrer. Il sent, fixe les gens, arpente les rues et tourne autour des btiments \r\n        pour mieux les immortaliser.',NULL,NULL,NULL,'fr_FR');
